import React, { useState } from "react";

const DietPlan = () => {
  const [formData, setFormData] = useState({
    name: "",
    age: "",
    weight: "",
    height: "",
    gender: "",
    dietaryPreference: "",
    activityLevel: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
  e.preventDefault();
  setSubmitted(true); // ✅ Correct: should set 'submitted', not 'formData'

  try {
    const response = await fetch("/dietplans", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    });

    if (response.ok) {
      const result = await response.text(); // ✅ Save result properly
      console.log("Diet plan entry created:", result);
      setSubmitted(true);
    } else {
      console.error("Failed to submit diet plan entry");
    }
  } catch (error) {
    console.error("Error submitting diet plan entry:", error);
  }
};


  const renderSuggestions = () => {
    const { dietaryPreference, activityLevel } = formData;
    if (!dietaryPreference || !activityLevel) {
      return (
        <p style={{ textAlign: "center" }}>
          Missing dietary or activity info. Please edit your details.
        </p>
      );
    }

    const basePlan =
      dietaryPreference === "vegetarian"
        ? [
            {
              name: "Oats with Fruits",
              img: "data:image/jpeg;base64,://source.unsplash.com/featured/?oats,fruits",
            },
            {
              name: "Lentil Soup",
              img: "https://source.data:image/jpeg;base64,.com/featured/?lentil,soup",
            },
            {
              name: "Vegetable Stir-Fry",
              img: "https://data:image/jpeg;base64,.unsplash.com/featured/?vegetable,stirfry",
            },
            {
              name: "Greek Yogurt",
              img: "data:image/jpeg;base64,:image/jpeg;base64,:image/jpeg;base64,://source.unsplash.com/featured/?greek,yogurt",
            },
          ]
        : [
            {
              name: "Egg Omelette",
              img: "data:image/jpeg;base64,",
            },
            {
              name: "Grilled Chicken Salad",
              img: "https://www.dinneratthezoo.com/wp-content/uploads/2020/12/grilled-chicken-salad-4.jpg",
            },
            {
              name: "Fish Curry",
              img: "data:image/jpeg;base64,",
            },
            {
              name: "Boiled Eggs",
              img: "data:image/jpeg;base64,",
            },
          ];

    const activityBoost =
      activityLevel === "high"
        ? [
            {
              name: "Protein Shake",
              img: "https://sourcdata:image/jpeg;base64,.unsplash.com/featured/?protein,shake",
            },
            {
              name: "Banana Pre-Workout",
              img: "https://source.undata:image/jpeg;base64,.com/featured/?banana",
            },
            {
              name: "Post-Workout Smoothie",
              img: "https://source.data:image/jpeg;base64,.com/featured/?smoothie",
            },
          ]
        : [
            {
              name: "Green Tea",
              img: "https://source.unsdata:image/jpeg;base64,:image/jpeg;base64,.com/featured/?green,tea",
            },
            {
              name: "Light Snacks",
              img: "https://source.unsplash.data:image/jpeg;base64,?snacks",
            },
            {
              name: "Fruit Bowl",
              img: "https://source.data:image/jpeg;base64,.com/featured/?fruit,bowl",
            },
          ];

    const fullPlan = basePlan.concat(activityBoost);

    return (
      <div style={styles.suggestions}>
        <h2 style={styles.heading}>🍽️ Your Personalized Diet Plan</h2>
        <div style={styles.grid}>
          {fullPlan.map((item, idx) => (
            <div key={idx} style={styles.card}>
              <img src={item.img} alt={item.name} style={styles.image} />
              <p style={styles.label}>{item.name}</p>
            </div>
          ))}
        </div>
        <button style={styles.button} onClick={() => setSubmitted(false)}>
          🔄 Edit Details
        </button>
      </div>
    );
  };

  return (
    <div style={styles.container}>
      {!submitted ? (
        <form onSubmit={handleSubmit} style={styles.form}>
          <h2 style={styles.heading}>📝 Enter Your Details</h2>

          <input
            type="text"
            name="name"
            placeholder="Name"
            value={formData.name}
            onChange={handleChange}
            style={styles.input}
            required
          />
          <input
            type="number"
            name="age"
            placeholder="Age"
            value={formData.age}
            onChange={handleChange}
            style={styles.input}
            required
          />
          <input
            type="number"
            name="weight"
            placeholder="Weight (kg)"
            value={formData.weight}
            onChange={handleChange}
            style={styles.input}
            required
          />
          <input
            type="number"
            name="height"
            placeholder="Height (cm)"
            value={formData.height}
            onChange={handleChange}
            style={styles.input}
            required
          />

          <select
            name="gender"
            value={formData.gender}
            onChange={handleChange}
            style={styles.select}
            required
          >
            <option value="">Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>

          <select
            name="dietaryPreference"
            value={formData.dietaryPreference}
            onChange={handleChange}
            style={styles.select}
            required
          >
            <option value="">Dietary Preference</option>
            <option value="vegetarian">Vegetarian</option>
            <option value="non-vegetarian">Non-Vegetarian</option>
          </select>

          <select
            name="activityLevel"
            value={formData.activityLevel}
            onChange={handleChange}
            style={styles.select}
            required
          >
            <option value="">Activity Level</option>
            <option value="low">Low</option>
            <option value="moderate">Moderate</option>
            <option value="high">High</option>
          </select>

          <button type="submit" style={styles.button}>
            🎯 Get Diet Plan
          </button>
        </form>
      ) : (
        renderSuggestions()
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "600px",
    margin: "2rem auto",
    padding: "1rem",
    fontFamily: "Arial, sans-serif",
    backgroundColor: "#f9f9f9",
    borderRadius: "12px",
    boxShadow: "0 0 10px rgba(0,0,0,0.1)",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: "12px",
  },
  input: {
    padding: "10px",
    fontSize: "16px",
    borderRadius: "6px",
    border: "1px solid #ccc",
  },
  select: {
    padding: "10px",
    fontSize: "16px",
    borderRadius: "6px",
    border: "1px solid #ccc",
  },
  button: {
    padding: "12px",
    fontSize: "16px",
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    marginTop: "10px",
  },
  heading: {
    textAlign: "center",
    marginBottom: "1rem",
    color: "#333",
  },
  suggestions: {
    textAlign: "center",
  },
  grid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(150px, 1fr))",
    gap: "16px",
    marginTop: "1rem",
  },
  card: {
    backgroundColor: "#fff",
    borderRadius: "8px",
    padding: "10px",
    boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
  },
  image: {
    width: "100%",
    height: "100px",
    objectFit: "cover",
    borderRadius: "6px",
  },
  label: {
    marginTop: "8px",
    fontWeight: "bold",
    fontSize: "14px",
  },
};

export default DietPlan;
